import { Container} from "react-bootstrap";

const Home = () => {
    return (
        <Container className='customContainer flex justify-content-space-around'>
            <img className='animation' style={{width:"40%"}}  src="art.jpg" alt="" />
            <div>
                <h3>Hi! Welcome to my portfolio.</h3>
                <p><span>Ella Mae Lumibao</span> is a <span>Portraitist</span>.<br/> Learnt 
                art from the online world.</p>

            </div>
        </Container>
    );
}

export default Home
